import React from "react";
import "./App.css";

// importing smaller components
import HeaderItem from "./HeaderItem";
import ButtonItem from "./ButtonItem";

function App() {
  return (
    <div className="App">
      <div id="header">
        <HeaderItem
          headerH1Item="Cory Cox Test Website"
          headerH2Item="Test site for Cory Cox"
          headerH3Item="Current Projects:"
        />
      </div>

      <div id="button-group">
        <ButtonItem btnItemUrl="/js-counter/" btnItemText="Counter" />
        <ButtonItem
          btnItemUrl="/random-number-draw/"
          btnItemText="Random Number"
        />
        <ButtonItem btnItemUrl="https://corycox.com/" btnItemText="Cory Cox" />
        <ButtonItem
          btnItemUrl="https://cubsplaytoday.com/"
          btnItemText="Cubs Play"
        />
      </div>
    </div>
  );
}

export default App;
